import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import ReactNavbar from "react-responsive-animate-navbar";


export class Navbar extends Component {
    render() {
      return (


      <nav>
        <ReactNavbar
        color="rgb(25, 25, 25)"
        logo="https://svgshare.com/i/KHh.svg"
        menu={[
          { name: "HOME", to: "/" },
          { name: "ARTICLES", to: "/articles" },
          { name: "ABOUT ME", to: "/about" },
          { name: "CONTACT", to: "/contact" },
        ]}
        social={[
          {
            name: "Linkedin",
            url: "https://www.linkedin.com/in/nazeh-taha/",
            icon: ["fab", "linkedin-in"],
          },
          {
            name: "Facebook",
            url: "https://www.facebook.com/nazeh200/",
            icon: ["fab", "facebook-f"],
          },
          {
            name: "Instagram",
            url: "https://www.instagram.com/nazeh_taha/",
            icon: ["fab", "instagram"],
          },
          {
            name: "Twitter",
            url: "http://nazehtaha.herokuapp.com/",
            icon: ["fab", "twitter"],
          },
        ]}
      />
          <ul>
            <li><Link to="/" class='link'>Home</Link></li>
            <li><Link to="/journal" class='link'>Journal</Link></li>
            <li><Link to="/selfcare" class='link'>Selfcare</Link></li>
            <ul>
              <li><Link to="/mental" class='link'>Mental Selfcare</Link></li>
              <li><Link to="/physical" class='link'>Physical Selfcare</Link></li>
              <li><Link to="/practical" class='link'>Practical Selfcare</Link></li>
              <li><Link to="/social" class='link'>Social Selfcare</Link></li>
              <Link to="javascript:void(0);" class='link' class="icon" onclick="myFunction()">
                <i class="fa fa-bars"></i>
              </Link>
            </ul>
        </ul>
      </nav>

    );
    }
  }

  export default Navbar;
